import './Scoreline.css'

function Scoreline(props) {

    let class2 = "score " + props.team +"2"
    let class1 = "teamname " + props.team +"1"

    return (

        <div className="wt20 scoreline">
            <div className={class1}>
                {props.team.toUpperCase()}
            </div>
            <div className={class2}>
                <div className="final_score">{props.score}</div>
                <div className="final_overs">({props.overs})</div>
            </div>
        </div>
    )

    }
export default Scoreline;
